import { Container } from "@mui/material";
import React from "react";
import { Button, Card } from "@mui/material";


export default function AutoNav(){
    return(
        <Card>
            <header>Destination select</header>
            <Button>Home</Button>
            <Button>Kitchen</Button>
        </Card>
    )
}
